import React from "react";
import Cards from "./Cards";
import Sdata from "./Sdata";

const Amazone = () => {
    return(
        <Cards 
        key= {Sdata[4].id}
        imgsrc= {Sdata[4].imgscr}
        title= {Sdata[4].title}
        sname= {Sdata[4].sname}
        link= {Sdata[4].links}
    />
    );
};
 export default Amazone;
